    println(f"Original tag: {tag}");
    println(f"Aggregated tag: {aggregated_tag}");
    println(f"Original tag: {tag}");
    println(f"Aggregated tag: {aggregated_tag}");
    println(f"Different pattern tag: {different_tag}");
